import {Link} from 'react-router-dom';
import './App.css';


function Navigation(){
    return ( 
        <div className='container'>
            <nav>
                <div>
                    <ul className = 'NavList'>
                        <li><Link to = '/'>About Us</Link></li>
                        <li><Link to = '/'>Registration</Link></li>
                    </ul>
                </div>
            </nav>
         </div>
    );
}
export default Navigation;
